svg.script:
habilitado = true;

function disable(milliseconds){
	$("#start").attr( "class" , 'disabled')
	$("#a").attr( "class" , 'disabled')
	$("#b").attr( "class" , 'disabled')
	$("#select").attr( "class" , 'disabled')
	$("#up").attr( "class" , 'disabled')
	$("#down").attr( "class" , 'disabled')
	$("#left").attr( "class" , 'disabled')
	$("#right").attr( "class" , 'disabled')
	$("#l").attr( "class" , 'disabled')
	$("#r").attr( "class" , 'disabled')

	habilitado = false;
	setTimeout(function(){
		habilitado = true;
		$("#start").removeAttr( "class" , 'disabled')
		$("#a").removeAttr( "class" , 'disabled')
		$("#b").removeAttr( "class" , 'disabled')
		$("#select").removeAttr( "class" , 'disabled')
		$("#up").removeAttr( "class" , 'disabled')
		$("#down").removeAttr( "class" , 'disabled')
		$("#left").removeAttr( "class" , 'disabled')
		$("#right").removeAttr( "class" , 'disabled')
		$("#l").removeAttr( "class" , 'disabled')
		$("#r").removeAttr( "class" , 'disabled')
	}, milliseconds);
}

function sendClickToParentDocument(evt)
    {
    	if(habilitado){
	    	window.parent.pressKey(evt);
	    	switch(evt) {
				case 'a': 
				case 'b': 
				case 'down': 
				case 'up': 
				case 'left': 
				case 'right': ms = 1000; break;
				case 'start': ms = 5000; break;
				case 'select': ms = 10000; break;
				default: ms = 2000; break;
			} 
			disable(ms);
		}
    }

	$('.boton').each(function(index) {
    	$(this).on('click', function(event){		    		
    		sendClickToParentDocument($(this).attr("id"));
	});

});

$('.boton').each(function(index) {
    	$(this).on('touchend', function(event){
    		sendClickToParentDocument($(this).attr("id"));
	});	
});
